INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(1, 'Coq au Vin', 'Guiso tradicional francés de pollo cocido en vino tinto', 'Este es un guiso tradicional francés que consiste en pollo cocido lentamente en vino tinto (generalmente de la región de Borgoña), con verduras y hierbas. Es un platillo caliente, sabroso y aromático, con un toque terroso gracias al vino. La carne queda tierna, y la salsa es rica y profunda en sabor.', NULL, , 'Plato Principal', 'Pollo, vino tinto, cebolla, zanahoria, champiñones, panceta, ajo, hierbas (tomillo, laurel)', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(2, 'Bouillabaisse', 'Sopa de pescado tradicional de Marsella', 'Es una sopa de pescado originaria de Marsella, Francia. Generalmente es servida caliente. Su sabor es profundo, sabroso y un poco picante, con un toque a mar gracias a los pescados y mariscos. Se sirve con una mayonesa de ajo llamada rouille y pan tostado.', NULL, , 'Sopa', 'Pescado (generalmente de la región costera), mariscos, tomates, cebolla, ajo, azafrán, aceite de oliva, hierbas (laurel, tomillo), caldo de pescado', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(3, 'Ratatouille', 'Estofado vegetal de la Provenza francesa', 'Es un estofado vegetal originario de la región de Provenza. Es un platillo caliente con una mezcla de verduras asadas o cocidas lentamente. Es sabroso, aromático y tiene un sabor ligeramente dulce y terroso gracias a las verduras frescas. Se puede servir como plato principal o acompañamiento.', NULL, , 'Vegetariano', 'Berenjena, calabacín, pimientos, tomate, cebolla, ajo, hierbas provenzales', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(4, 'Confit de Canard', 'Pato cocido lentamente en su propia grasa', 'El pato se cocina a fuego lento en su propia grasa hasta que está extremadamente tierno y jugoso. Se sirve caliente, con la piel crujiente. Tiene un sabor muy intenso y rico debido al proceso de cocción largo y al uso de la grasa de pato.', NULL, , 'Plato Principal', 'Pato, grasa de pato, ajo, tomillo, sal, pimienta', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(5, 'Foie Gras', 'Hígado graso de pato o ganso, delicatessen francesa', 'Es un hígado graso de pato o ganso, muy suave y cremoso. Es un platillo delicado y de lujo, que se puede servir frío (como paté) o caliente (a la plancha). Su sabor es rico, suave y un poco dulce, y tiene una textura muy untuosa.', NULL, , 'Entrada', 'Hígado de pato o ganso, sal, pimienta, a veces especias o vino dulce', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(6, 'Escargot', 'Caracoles en mantequilla de ajo y perejil', 'Este platillo consiste en caracoles cocinados en una mezcla de mantequilla, ajo y hierbas. Se sirve caliente, generalmente en su concha. Tiene un sabor delicado y la mantequilla de ajo es la que aporta la mayor parte del sabor. La textura es algo gelatinosa, pero es un platillo muy apreciado en la gastronomía francesa.', NULL, , 'Entrada', 'Caracoles, mantequilla, ajo, perejil, sal, pimienta', '2025-11-03 16:38:53', 1),
(7, 'Croque-Monsieur', 'Sándwich gratinado con jamón y queso', 'Es un sándwich caliente que se cubre con una capa de salsa bechamel y queso rallado, luego se gratina en el horno. El resultado es un plato cremoso, con un sabor a queso fundido y un toque salado del jamón. Es muy popular como comida rápida o en cafés.', NULL, , 'Plato Principal', 'Pan de molde, jamón, queso gruyère, bechamel (salsa blanca)', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(8, 'Quiche Lorraine', 'Tarta salada con huevo, crema y bacon', 'Es una tarta salada que se llena con una mezcla de huevos, crema y bacon (y a veces queso). Se hornea hasta que la mezcla se coagula. Es un platillo que se puede servir caliente o a temperatura ambiente. Tiene una textura suave y cremosa, con un sabor salado y ligeramente ahumado por el bacon.', NULL, , 'Plato Principal', 'Masa quebrada, huevos, nata (crema de leche), queso, bacon o panceta, cebolla', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(9, 'Tarte Tatin', 'Tarta de manzana caramelizada invertida', 'Es una tarta de manzana invertida, cocida en azúcar y mantequilla hasta que las manzanas se caramelizan. Se cubre con una capa de masa y se hornea. Es un postre caliente, con un sabor dulce y afrutado, y una textura crujiente por fuera y suave por dentro.', NULL, , 'Postre', 'Manzanas, azúcar, mantequilla, masa quebrada o hojaldre', '2025-11-03 16:38:53', 1);
INSERT INTO `platillos` (`id_platillo`, `nombre_platillo`, `descripcion_corta`, `descripcion`, `video`, `imagen`, `tipo`, `ingredientes`, `fecha_creacion`, `activo`) VALUES
(10, 'Crème Brûlée', 'Crema catalana con capa de azúcar caramelizado', 'Es un postre de crema catalana que se cocina hasta obtener una textura suave y cremosa, pero se cubre con una capa de azúcar que luego se carameliza con un soplete. Tiene un sabor dulce, con un toque a vainilla, y una textura suave en contraste con la capa crujiente de azúcar caramelizado.', NULL, , 'Postre', 'Yemas de huevo, nata (crema de leche), azúcar, vainilla', '2025-11-03 16:38:53', 1);

